void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
	float time=(sqrt(iTime))*sin(iTime)*0.5;
	vec2 uv = (fragCoord.xy / iResolution.xx-.5)*6.0;
    vec2 uv0=uv;
	float i0=1.1;
	float i1=1.0;
	float i2=1.0;
	float i4=0.0;
	for(int s=0;s<6;s++)
	{
		vec2 r;
		r=vec2(sin(uv.y*i0-i4+time/i1*0.1),tan(uv.x*i0-i4+time/i1))/i2;
        r+=vec2(-r.y,r.x)*0.1;
		uv.xy+=r;

		i0*=2.93;
		i1*=5.15;
		i2*=3.7;
		i4-=0.02+1.1*time*i1;
	}
    float r=sqrt(uv.x-time)*0.6+1.5;
    float b=log(uv.y+time)*0.5+01.5;
    float g=tan((uv.x+uv.y+sin(time*0.5))*0.5)*0.5+1.5;
	fragColor = vec4(r,g,b,1.0);
}
